//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

contract DCTDstaking {
    mapping (address => uint256) public stakes;

    string public name;
    address  public tokenAddress;
    uint public stakingStarts;
    uint public stakingEnds;
    uint public withdrawStarts;
    uint public withdrawEnds;
    uint256 public stakedTotal;
    uint256 public stakingCap;
    uint256 public totalReward;
    uint256 public earlyWithdrawReward;
    uint256 public rewardBalance;
    uint256 public stakedBalance;

    ERC20 public ERC20Interface;
    event Staked(address indexed token, address indexed staker_, uint256 requestedAmount_, uint256 stakedAmount_);
    event PaidOut(address indexed token, address indexed staker_, uint256 amount_, uint256 reward_);
    event Refunded(address indexed token, address indexed staker_, uint256 amount_);

    constructor (string memory name_,
        address tokenAddress_,
        uint stakingStarts_,
        uint stakingEnds_,
        uint withdrawStarts_,
        uint withdrawEnds_,
        uint256 stakingCap_) {
        name = name_;
        require(tokenAddress_ != address(0), "DCTDstaking: 0 address");
        tokenAddress = tokenAddress_;

        require(stakingStarts_ > 0, "DCTDstaking: zero staking start time");
        if (stakingStarts_ < block.timestamp) {
            stakingStarts = block.timestamp;
        } else {
            stakingStarts = stakingStarts_;
        }

        require(stakingEnds_ > stakingStarts, "DCTDstaking: staking end must be after staking starts");
        stakingEnds = stakingEnds_;

        require(withdrawStarts_ >= stakingEnds, "DCTDstaking: withdrawStarts must be after staking ends");
        withdrawStarts = withdrawStarts_;

        require(withdrawEnds_ > withdrawStarts, "DCTDstaking: withdrawEnds must be after withdraw starts");
        withdrawEnds = withdrawEnds_;

        require(stakingCap_ > 0, "DCTDstaking: stakingCap must be positive");
        stakingCap = stakingCap_;
    }

    function addReward(uint256 rewardAmount, uint256 withdrawableAmount)
    public
    _before(withdrawStarts)
    _hasAllowance(msg.sender, rewardAmount)
    {
        require(rewardAmount > 0, "DCTDstaking: reward must be positive");
        require(withdrawableAmount >= 0, "DCTDstaking: withdrawable amount cannot be negative");
        require(withdrawableAmount <= rewardAmount, "DCTDstaking: withdrawable amount must be less than or equal to the reward amount");
        address from = msg.sender;
        if (!_payMe(from, rewardAmount)) {
            return;
        }

        totalReward = totalReward + rewardAmount;
        rewardBalance = totalReward;
        earlyWithdrawReward = earlyWithdrawReward + withdrawableAmount;
    }


     /**
    * Requirements:
    * - `amount` Amount to be staked
    */
    function stake(uint256 amount)
    public
    _positive(amount)
    _realAddress(msg.sender)
    {
        address from = msg.sender;
        _stake(from, amount);
    }

    function withdraw(uint256 amount)
    public
    _after(withdrawStarts)
    _positive(amount)
    _realAddress(msg.sender)
    {
        address from = msg.sender;
        require(amount <= stakes[from], "DCTDstaking: not enough balance");
        if (block.timestamp < withdrawEnds) {
            _withdrawEarly(from, amount);
        } else {
            _withdrawAfterClose(from, amount);
        }
    }

    function _withdrawEarly(address from, uint256 amount)
    private
    _realAddress(from)
    {
        // This is the formula to calculate reward:
        // r = (earlyWithdrawReward / stakedTotal) * (now - stakingEnds) / (withdrawEnds - stakingEnds)
        // w = (1+r) * a
        uint256 denom = (withdrawEnds - stakingEnds) * stakedTotal;
        uint256 reward = 
        ( (block.timestamp - stakingEnds)*earlyWithdrawReward* amount
        ) / denom;
        uint256 payOut = amount + reward;
        rewardBalance = rewardBalance - reward;
        stakedBalance = stakedBalance - amount;
        stakes[from] = stakes[from] - amount;
        require(_payDirect(from, payOut),"DCTDstaking: Error in withdrowEarly.");
        emit PaidOut(tokenAddress, from, amount, reward);

    }

    function _withdrawAfterClose(address from, uint256 amount)
    private
    _realAddress(from)
    {
        uint256 reward = (rewardBalance*amount)/stakedBalance;
        uint256 payOut = amount + reward;
        stakes[from] = stakes[from] - amount;
        require(_payDirect(from, payOut),"DCTDstaking: Error in withdrow.");
        emit PaidOut(tokenAddress, from, amount, reward);
    }

    function _stake(address staker, uint256 amount)
    private
    _after(stakingStarts)
    _before(stakingEnds)
    _positive(amount)
    _hasAllowance(staker, amount)
    {
        // check the remaining amount to be staked
        uint256 remaining = amount;
        if (remaining > (stakingCap - stakedBalance)) {
            remaining = stakingCap - stakedBalance;
        }
        // These requires are not necessary, because it will never happen, but won't hurt to double check
        // this is because stakedTotal and stakedBalance are only modified in this method during the staking period
        require(remaining > 0, "DCTDstaking: Staking cap is filled");
        require((remaining + stakedTotal) <= stakingCap, "DCTDstaking: this will increase staking amount pass the cap");
        require(_payMe(staker, remaining), "DCTDstaking: Error in trasnfer");
        emit Staked(tokenAddress, staker, amount, remaining);

        if (remaining < amount) {
            // Return the unstaked amount to sender (from allowance)
            uint256 refund = amount - remaining;
            if (_payTo(staker, staker, refund)) {
                emit Refunded(tokenAddress, staker, refund);
            }
        }

        // Transfer is completed
        stakedBalance = stakedBalance + remaining;
        stakedTotal = stakedTotal + remaining;
        stakes[staker] = stakes[staker] + remaining;
    }

    function _payMe(address payer, uint256 amount)
    private
    returns (bool) {
        return _payTo(payer, address(this), amount);
    }

    function _payTo(address allower, address receiver, uint256 amount)
    _hasAllowance(allower, amount)
    private
    returns (bool) {
        // Request to transfer amount from the contract to receiver.
        // contract does not own the funds, so the allower must have added allowance to the contract
        // Allower is the original owner.
        ERC20Interface = ERC20(tokenAddress);
        return ERC20Interface.transferFrom(allower, receiver, amount);
    }

    function _payDirect(address to, uint256 amount)
    private
    _positive(amount)
    returns (bool) {
        ERC20Interface = ERC20(tokenAddress);
        return ERC20Interface.transfer(to, amount);
    }

    modifier _realAddress(address addr) {
        require(addr != address(0), "DCTDstaking: zero address");
        _;
    }

    modifier _positive(uint256 amount) {
        require(amount >= 0, "DCTDstaking: negative amount");
        _;
    }

    modifier _after(uint eventTime) {
        require(block.timestamp >= eventTime, "DCTDstaking: bad timing for the request");
        _;
    }

    modifier _before(uint eventTime) {
        require(block.timestamp < eventTime, "DCTDstaking: bad timing for the request");
        _;
    }

    modifier _hasAllowance(address allower, uint256 amount) {
        // Make sure the allower has provided the right allowance.
        ERC20Interface = ERC20(tokenAddress);
        uint256 ourAllowance = ERC20Interface.allowance(allower, address(this));
        require(amount <= ourAllowance, "DCTDstaking: Make sure to add enough allowance");
        _;
    }


}

